import React from "react";

const Learn_Bgsection = ({ car }) => {
  return (
    <section className="h-[120vh] padding">
      <div
        className=" flex flex-col justify-end bg-fullcenter shadowAround"
        style={{ backgroundImage: "url(" + car.cover + ")" }}
      >
        <div className="max-w-[500px]">
          <h3 className="title">{car.title}</h3>
          <p>{car.describe}</p>
        </div>
      </div>
    </section>
  );
};

export default Learn_Bgsection;
